function padIntoTwoDigitString(t){return t.toString().padStart(2,"0")}function replaceTextContent(t,e,n){t.textContent=t.textContent.replace(e,n)}function renderDate(){let t=new Date;let e=t.getFullYear();let n=padIntoTwoDigitString(t.getMonth()+1);let a=padIntoTwoDigitString(t.getDate());let l=document.getElementsByClassName("js-date");for(let t=0;t<l.length;t++){let o=l[t];replaceTextContent(o,/yyyy/g,e);replaceTextContent(o,/mm/g,n);replaceTextContent(o,/dd/g,a)}}function renderMaths(){let t=document.getElementsByClassName("js-maths");for(let e=0;e<t.length;e++){let n=t[e];katex.render(n.textContent,n,{displayMode:n.tagName=="DIV"})}}